// import {NavDropdown} from 'react-bootstrap';
import { Container, Row, Col } from "react-bootstrap";
function NavBar() {
  return (
    <div className="mainnavbar ">
      <Container fluid="md">
        <Row >
          <Col >
            1 of 3
          </Col>
        </Row>
      </Container>
    </div>
  );
}
export default NavBar;
